import React from "react";

class Valikot extends React.Component() {
  constructor(props) {
    super(props);
    this.state = {
      maakunnat: [],
    };
  }

  render() {}
}

componentDidMount: {
  this.setState({ maakunnat: props });
  console.log("Valikoissa!");
}

export default Valikot;
